"use strict";(self.webpackChunkcybersec_notes=self.webpackChunkcybersec_notes||[]).push([[6824],{23168:function(t){t.exports=JSON.parse('{"name":"intro","permalink":"/Cybernotes/docs/tags/intro","docs":[{"id":"portswigger/Authentication/Brute-force attacks","title":"Brute force attacks","description":"A brute-force attack is when an attacker uses a system of trial and error in an attempt to guess valid user credentials. These attacks are typically automated using wordlists of usernames and passwords. Automating this process, especially using dedicated tools, potentially enables an attacker to make vast numbers of login attempts at high speed.","permalink":"/Cybernotes/docs/portswigger/Authentication/Brute-force attacks"},{"id":"intro","title":"Welcome to cybernotes","description":"Cybernotes is a collection of cybersecurity notes and CTF writeups","permalink":"/Cybernotes/docs/intro"},{"id":"portswigger/Command-Injection/Intro","title":"What is OS command injection?","description":"OS command injection (also known as shell injection) is a web security vulnerability that allows an attacker to execute arbitrary operating system (OS) commands on the server that is running an application, and typically fully compromise the application and all its data. Very often, an attacker can leverage an OS command injection vulnerability to compromise other parts of the hosting infrastructure, exploiting trust relationships to pivot the attack to other systems within the organization.","permalink":"/Cybernotes/docs/portswigger/Command-Injection/Intro"}],"allTagsPath":"/Cybernotes/docs/tags"}')}}]);